import React from 'react'
import * as FaICons from "react-icons/fa"
import * as AiIcons from "react-icons/ai"
import * as GrIcons from "react-icons/gr"

export const SideBarData = [
    {
        title : 'Home',
        path:'/',
        icon:<AiIcons.AiFillHome/>,
        cName:'nav-text'
    },
    {
        title : 'Workers',
        path:'/workers',
        icon:<GrIcons.GrUserWorker color='#fff'/>,
        cName:'nav-text'
    }, {
        title : 'Vechiles',
        path:'/Vechiles',
        icon:<FaICons.FaCarSide color='#fff'/>,
        cName:'nav-text'
    }, {
        title : 'IncomeAndOutcome',
        path:'/incomeAndOutcome',
        icon:<GrIcons.GrMoney/>,
        cName:'nav-text'
    }, {
        title : 'Schedule',
        path:'/schedule',
        icon:<GrIcons.GrSchedule/>,
        cName:'nav-text'
    },
    
]
